import styled from 'styled-components';
import IntroSec1 from '../images/intro-sec1.png';

const Intro = () => {
  const introSec1 = IntroSec1;

  return (
    <div>
      <section>
        <article>
          <img src={introSec1} alt="sec1" />
          <div>sec1</div>
        </article>
        <article>
          <img src={introSec1} alt="sec1" />
          <div>sec2</div>
        </article>
        <article>
          <img src={introSec1} alt="sec1" />
          <div>sec3</div>
        </article>
        <article>
          <img src={introSec1} alt="sec1" />
          <div>sec4</div>
        </article>
      </section>
    </div>
  );
};

export default Intro;
